settings.colorFunction:
var type = dsData[dsIndex]['type'];
if (type == 'colorpin') {
	var temperature = dsData[dsIndex]['temperature'];
	if (typeof temperature !== undefined) {
	    var percent = (temperature + 60)/120 * 100;
	    return tinycolor.mix('blue', 'red', amount = percent).toHexString();
	}
	return 'blue';
}

settings.markerImageFunction:
var type = dsData[dsIndex]['mapType'];
var res;
if (typeof type !== undefined) {
if (type == 'tracker') {
	    res = {
	    url: images[0],
	    size: 50
	    };
	} else {
	    res = {
	    url: images[1],
	    size: 50
	    };
	}

	return res;
}

settings.tooltipFunction:
var type = dsData[dsIndex]["mapType"];
if (typeof type !== undefined) {
    if (type == "tracker") {
        return '<div style="color:black"><b>${entityName}</b><br><br><b>Latitude:</b> ${latitude:7}<br><b>Longitude:</b> ${longitude:7}<br><br><link-act name="tracker_tag_action">Tracker details</link-act><br></div>';
    }
}

